package JavaBasic;

public class Displayinteger {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for (int i=1;i<=30;i++) {  //the range of i that we are going to output
			int square = i*i;// the process of squaring i
			System.out.println(square);//output
		}
	}
}
